*/

:root {
  --background-image: url("https://cdn.discordapp.com/attachments/1187887838633660511/1188699299752726548/photo-1651838982320-466988971938.webp?ex=659b797e&is=6589047e&hm=3c0e37306aaa4beb65db92352dd8d6bbaf0649b0657ccec244a6aa004abfb376&");
  --background-image-blur: 12px;
  --background-image-size: cover;
  --background-image-position: center;
  --popout-image: var(--background-image);
  --popout-image-blur: 4px;
  --popout-image-size: cover;
  --popout-image-position: center;
  --overlay-image: var(--background-image);
  --overlay-image-blur: 1px;
  --overlay-image-size: cover;
  --overlay-image-position: center;
  --home-button-image: url('https://i.imgur.com/rDzAwMc.jpg');
  --home-button-size: 160%;
  --home-button-position: center;
  --serverlist-brightness: 0.72;
  --left-brightness: 0.46;
  --middle-brightness: 0.62;
  --right-brightness: 0.3;
  --overlay-brightness: 0.56;
  --gradient-primary: 78,28,168;
  --gradient-secondary: 31,47,140;
  --link-colour: #61D3FF;
  --scrollbar-colour: rgba(255,255,255,0.05);
  --gradient-direction: 0deg;
  --tint-colour: 20,7,114;
  --tint-brightness: 0.22;
  --font: Arial black;
  --window-padding: 7px;
  --window-roundness: 20px;
  --update-notice-1: none;
}
